RT @mnt_io : `let else` in Rust is stabilized, https://t.co/8mI6LHgdMY.

RFC 3137, https://t.co/XdEcGyOLHy.

```
let Some(foo) = bar else { baz }
```

is a syntactic sugar to a longer syntax in Rust today, e.g.:

```
let foo = match bar {
    Some(foo) =&gt; foo,
    _ =&gt; baz,
};
```

